import React, {Component} from 'react';
import { compose, withProps } from 'recompose';
import { withScriptjs, withGoogleMap, GoogleMap, Marker } from "react-google-maps";

const MapComponent = compose (
    withProps({
        googleMapURL: "https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places",
        loadingElement: <div style={{ height: '100%' }} />,
        containerElement: <div style={{ height: '400px' }} />,
        mapElement: <div style={{ height: '100%' }} />
    }),
    withScriptjs,
    withGoogleMap
)((props) =>
    <GoogleMap
        defaultZoom={14}
        defaultCenter={{ latitude: props.currentLatLng.latitude, longitude: props.currentLatLng.longitude }}
    >
        {props.isMarkerShown &&
            <Marker
                position={{ latitude: props.currentLatLng.latitude, longitude: props.currentLatLng.longitude }}
                onClick={props.handleMarkerClick}
            />
        }
    </GoogleMap>
)

export default MapComponent;
